import "./App.css";
import { Route, Routes } from "react-router-dom";
import Main from "../src/pages/Main.js";
function App() {
  return (
    <>
      <Routes>
        <Route component={Main} path="/" />
      </Routes>
    </>
  );
}

export default App;
